import styled from "styled-components"
import { UnderConstruction } from "../UnderConstruction"

export const ResearchPage = () => {
    return (
        <Content>
            <UnderConstruction />
        </Content>
    )
}

const Tabs = () => {
    return (
        <div>
            <div></div>
            <div></div>
            <div></div>
        </div>
    )
}

// styled components ------------------------------------------------------------------
const Content = styled.div({
    paddingTop: 50
})

const TabContainer = styled.div({
    border: "1px solid green",
    width: "100%",
    height: "15px",
    display: "flex",
    flexDirection: "row",
    justifyContent: "center",
    alignItems: "center",
    color: "#707070",
    marginRight: "55px",
    cursor: "pointer"
})
